Tamuda (; ) is a rural locality (a selo) in Mazadinsky Selsoviet, Tlyaratinsky District, Republic of Dagestan, Russia. Population:
Geography
Tamuda is located 23&nbsp;km north of Tlyarata (the district's administrative centre) by road. Khobokh is the nearest rural locality.
